import React from 'react'
import "./card.css"
import {MoreHorizontal} from "react-feather";
import {Labels} from '../Labels/Labels';

export const Card = ()=> {
  
    return (
      <div className='card'>
        <div className='card_title'>
            <div className='card_labels'>
              <Labels text = "FrontEnd" color = "blue" />
            </div>
            <MoreHorizontal />
        </div>
      </div>
    );
  
}
